import React, { useEffect, useState } from 'react';

function App() {
    const [signals, setSignals] = useState({});

    useEffect(() => {
        const fetchSignals = async () => {
            try {
                const response = await fetch('http://localhost:5001/signals'); // Adjust the URL if necessary
                if (!response.ok) {
                    throw new Error('Failed to fetch signals');
                }
                const data = await response.json();
                console.log('Fetched signals:', data); // Log the fetched data
                setSignals(data);
            } catch (error) {
                console.error('Error fetching signals:', error);
            }
        };

        fetchSignals();

        const interval = setInterval(fetchSignals, 60000); // Refresh every 60 seconds
        return () => clearInterval(interval); // Cleanup interval on component unmount
    }, []);

    const stockDetails = {
        cdr: { name: 'CD Projekt Red', shares: 1, profit: '100 PLN' },
        rbw: { name: 'Rainbow', shares: 1, profit: '50 PLN' },
    };

    return (
        <div className="App">
            <header>
                <h1>Stock Signal Dashboard</h1>
            </header>
            <main>
                {Object.keys(signals).length > 0 ? (
                    <table border="1" style={{ width: '100%', textAlign: 'left', borderCollapse: 'collapse' }}>
                        <thead>
                            <tr>
                                <th>Full Name</th>
                                <th>Symbol</th>
                                <th>Shares</th>
                                <th>Signal</th>
                                <th>Profit</th>
                            </tr>
                        </thead>
                        <tbody>
                            {Object.entries(signals).map(([symbol, signal], index) => (
                                <tr key={index}>
                                    <td>{stockDetails[symbol]?.name || 'Unknown'}</td>
                                    <td>{symbol.toUpperCase()}</td>
                                    <td>{stockDetails[symbol]?.shares || 0}</td>
                                    <td>{signal}</td>
                                    <td>{stockDetails[symbol]?.profit || '0 PLN'}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                ) : (
                    <p>Loading signals...</p>
                )}
            </main>
        </div>
    );
}

export default App;
